import React from "react";
import AddFishForm from "./AddFishForm";
import EditFishForm from "./EditFishForm";

class Inventory extends React.Component {
    /* {this.props.fishes.map(fish => <EditFishForm/>)} */
    render() {
        return (
                <div className="inventory">
                    <h2>Inventory</h2>
                        {Object.keys(this.props.fish).map(key => <EditFishForm key={key} index={key} deleteFish={this.props.deleteFish} fish={this.props.fish[key]} updateFish={this.props.updateFish} />)}
                        <AddFishForm addFish={this.props.addFish}/>
                        <button onClick={this.props.loadSample}>Load Sample Data</button>
                </div>
        )
    }
}

export default Inventory;
